import { Container, Row, Col } from "shards-react";
import Heading from "./components/Heading/Heading.js";
import DailyCard from "./components/Daily/DailyCard.js";
import BobaTracker from "./components/BobaTracker/BobaTracker.js";

import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css";
import "./App.css";

function App() {
  return (
    <Container fluid className="justify-content-center align-items-center">
      {/* HEADING */}
      <Row className="d-flex flex-column justify-content-center align-items-center">
        <Col sm="12" md="12" lg="9" className="block justify-content-center">
          <Heading />
        </Col>
      </Row>
      {/* DAILY */}
      <Row className="d-flex flex-column justify-content-center align-items-center">
        <Col sm="12" md="3" lg="3">
          <DailyCard />
        </Col>
        <Col sm="12" md="3" lg="3">
          <DailyCard />
        </Col>
        <Col sm="12" md="3" lg="3">
          <DailyCard />
        </Col>
      </Row>
      {/* BOBA */}
      <Row className="d-flex flex-column justify-content-center align-items-center">
        <Col sm="12" md="12" lg="9" className="pink block">
          <BobaTracker />
        </Col>
      </Row>
      {/* COFFEE */}
      <Row className="d-flex flex-column justify-content-center align-items-center">
        <Col sm="12" md="12" lg="9" className="brown block">
          <DailyCard />
        </Col>
      </Row>
    </Container>
  );
}

export default App;
